import React from "react";

class ReadText extends React.Component{
    constructor(props) {
        super(props);
        this.state={}
    }
    render() {
        return (
            <div>
                <ul>
                    <li>1</li>
                    <li>2</li>
                    <li>3</li>
                    <li>4</li>
                    <li>5</li>
                </ul>
            </div>
        )
    }
}

export default ReadText;
